INSERT INTO `tblevents` (`eventid`, `vendorid`, `todate`, `fromdate`, `location`, `totime`, `fromtime`, `eventname`, `description`, `eventtype`, `cost`, `status`, `latitude`, `longitude`, `bannerimage`, `bannerimagepath`) VALUES
(9, 25, '2016-08-24', '2016-08-23', 'N Convention, Hyderabad, Telangana, India', '', '', 'Big Cine Expo 2016', '23 - 24 August 2016\r\nN Convention, Hyderabad, Telangana.\r\n\r\n \r\n\r\nWith 17 years of enriching experience in the culture of cinema exhibition, TheatreWorld magazine now brings its very own expo for the exhibition community -- BigCineExpo!\r\n\r\n \r\n\r\nBigCineExpo 2016 (www.bigcineexpo.com) is an interactive and value-added platform for Theatre Owners, Design Consultants, Equipment Manufacturers, System Integrators, Project Management Professionals, Industry Stakeholders and the user community of Single-Screen and Multiplex cinema entertainment in Asia and India.\r\n\r\n \r\n\r\nHIGHLIGHTS:\r\n\r\n \r\n\r\nIndian industry is second only to Hollywood in size\r\nIndia produces highest number of movies in the world (1100++ movies in 2014)\r\nIndia is one of the world''s emerging economies with the entertainment sector occupying a dominant position\r\nSouth India has a massive movie industry size with 6,000 of the total estimated 9,500 screens in the country. With 70% of India''s total number of cinemas in South India, it also produces 82% of the total movies in the country\r\nBigCineExpo is poised to be the only expo of its kind in India dedicated to all aspects of cinema exhibition\r\nChennai is the main destination for buyers in South India for cinema exhibition equipment\r\nChennai Trade Centre is one of India''s best state-of-the-art infrastructures to showcase products\r\n \r\n\r\nWHY IN INDIA?\r\n\r\n \r\n\r\nAsian countries are surging ahead. India is one of the worlds emerging economies with the entertainment sector occupying a dominant position. In fact, Indian cinema industry is second only to Hollywood in size. South India, having the highest number of cinema screens and highest number of movie releases, is the top market for cinema exhibition in India.\r\n\r\n \r\n\r\nThe 21st century belongs to Asia, more specifically to China and India, the two fastest growing economies of the world. By 2025, China and India are expected to be the second and third largest economies respectively.\r\n\r\n \r\n\r\nThere is a huge appetite for technical knowhow and equipment owing to the untapped potential in the cinema theatre market in India and the other Asian countries. There is a huge gap that needs to be filled in. And here lies an opportunity for a viable platform in India to showcase competencies, safeguard interests and share expertise with Asia and the rest of world.', NULL, NULL, '1', '', '', 'BCE-2_t.jpg', ''),
(10, 25, '2016-09-04', '2016-08-21', 'Hyderabad, Telangana, India', '', '', 'Dynamic Dance Zone Footlooze 5', 'Dynamic Dance Zone presents the fifth edition of Footlooze \r\n\r\nA dance platform for all you talented dancers.\r\n\r\nThe Footlooze Dance competitions helps to promote the art of dance and creates a positive outlet for kids and youth. The competition allows young talent to explore their creativity and inspire each other, as well as the outside community.', NULL, NULL, '1', '', '', 'Dynamic-b_banner1470141140.png', ''),
(11, 25, '2016-08-28', '2016-08-21', 'Leisure Valley Park,Sector 29, Hyderabad, Telangana, India', '', '', 'Rhythm 2016 With Atif Aslam', 'Rhythm 2016 is a musical journey to take a step to entertain the audience with providing them the best performers of industry. Beginning with this musical concert featuring best Bollywood singers to perform at your city. They expect a footfall of over 10,000 people and the special marketing strategies and fan following of celebrity performers may increase the crowd. The young and dynamic team will promote the event with the latest technologies and unique marketing plans all over Delhi.\r\nThis event will provide a platform to all associating brands to promote and interact with mass\r\naudience under one roof. The event is planned, conceptualized, promoted and executed by Saffire Entertainment.', NULL, NULL, '1', '', '', 'Rhythm-b_banner1471500649.png', ''),
(12, 25, '2016-09-03', '2016-08-21', 'Hyderabad, Telangana, India', '', '', 'Accelerate Your Success', 'Whether you are a small business owner or an individual who is passionate about building his own enterprise, chances are that there would have been moments in your life where you found yourself stuck and the progress seem to slow down.\r\n\r\n\r\nAccelerate Your Success workshop introduces you to simple and practical strategies that can significantly improve the quality of your business and overall life.', NULL, NULL, '1', '', '', 'Meraevent_banner1470552338.jpg', '');
