(1, 'Golconda Fort', 'places', 'Ibrahim Bagh, Hyderabad, Telangana 500008', 'hyderabad', '17.3836 ', '78.4015', 'Golkonda, also known as Golconda or Golla konda ("shepherd''s hill"), is a citadel and fort in Southern India and was the capital of the medieval sultanate of the Qutb Shahi dynasty (c.15181687), is situated 11 kilometres (6.8 mi) west of Hyderabad.', 'Historic', '2016-06-12 03:45:18', 'admin', '2016-06-12 06:03:58', 'admin', 1),
(2, 'Lumbini Park', 'places', 'Opposite Secretariat New Gate, Khairatabad, Hyderabad, Telangana 500004', 'Hyderabad', '17.410057', '78.473219', 'Lumbini Park is a small public, urban park of 7.5 acres (0.030 km2; 0.0117 sq mi) adjacent to Hussain Sagar in Hyderabad, India.', 'Fun place', '2016-06-12 06:07:49', 'admin', '2016-06-12 06:16:00', 'admin', 1),
(3, 'Prasads Imax', 'places', 'NTR Gardens, LIC Division P.O., Hyderabad, Telangana 500063', 'Hyderabad', '17.412864', '78.465915', 'Prasad''s is a centrally air conditioned multiplex of an area of 2,35,000 sq ft, housing an IMAX Movie Theatre, a five screen multiplex, food court, multinational fast food outlets, a gaming zone and a Shopping mall covering two levels of the complex.', 'fun,food', '2016-06-12 06:12:05', 'admin', '2016-06-12 06:16:48', 'admin', 1),
(4, 'Peddamma Temple', 'places', 'Hitech City Road, Jubilee Hills, Hyderabad, Telangana 500033', 'hyderabad', '17.4921 ', '78.4073', 'Peddamma temple is an Hindu temple located at Jubilee Hills in Hyderabad. It is very famous during the festive season of Bonaalu.', 'temple', '2016-06-12 06:15:00', 'admin', NULL, NULL, 1),
(5, 'Charminar', 'places', 'Hyderabad, Telangana 500002', 'Hyderabad', '17.362854', '78.474622', 'The Charminar, constructed in 1591 CE, is a monument and mosque located in Hyderabad, Telangana, India. The landmark has become a global icon of Hyderabad, listed among the most recognized structures of India.', '"One of the most beautiful historical place."', '2016-06-15 12:57:40', 'admin', NULL, NULL, 1),
(6, 'Hussain Sagar', 'places', '\r\nHussain Sagar, Hyderabad, Telangana', 'Hyderabad', '17.425906', '78.473744', 'Hussain Sagar is a lake in Hyderabad built by Hazrat Hussain Shah Wali in 1562, during the rule of Ibrahim Quli Qutub Shah. It is spread across an area of 5.7 square kilometers and is fed by River Musi.', 'Fun Place', '2016-06-15 01:02:17', 'admin', NULL, NULL, 1),
(7, 'Birla Mandir', 'places', 'Hill Fort Rd, Hyderabad, Telangana 500004', 'Hyderabad', '17.407363', '78.469146', 'Birla Mandir is a Hindu temple, built on a 280 feet high hillock called Naubath Pahad on a 13 acres plot. The construction took 10 years and was constructed in 1976 by Swami Ranganathananda of Ramakrishna Mission.', 'Imposing, hilltop Hindu temple built of white marble, with towers, shrines and interior carvings.', '2016-06-15 04:09:01', 'admin', NULL, NULL, 1),
(8, 'Taj Falaknuma Palace', 'places', 'Engine Bowli, Falaknuma, Hyderabad, Telangana 500053', 'Hyderabad', '17.332538', '78.466000', 'Set in a restored 19th-century palace overlooking the city, this luxe hotel is 2 km from Falaknuma train station and 4 km from the landmark 16th-century Charminar mosque.', '', '2016-06-15 04:12:27', 'admin', NULL, NULL, 1),
(9, 'NTR Gardens', 'places', 'NTR Marg, Central Secretariat, Khairatabad, Hyderabad, Telangana 500004', 'Hyderabad', '17.412586', '78.468763', 'NTR Gardens is a small public, urban park of 36 acres adjacent to Hussain Sagar lake in Hyderabad,', 'Urban park covering 34 acres, with family attractions, a restaurant, fountains & a Japanese garden.', '2016-06-15 04:18:09', 'admin', NULL, NULL, 1),
(10, 'Ramoji Film City', 'places', 'Anaspur Village, Hayathnagar Mandal, Hyderabad, Telangana 501512', 'Hyderabad', '17.255264', '78.680853', 'The Ramoji Film City in India is located in Hyderabad. At 2000 acres, it is the largest integrated film city in the world. ', 'The world''s largest film studio offering tours, live shows, on-site theme park and adventure zone.', '2016-06-15 04:21:04', 'admin', NULL, NULL, 1),
(11, 'Salar Jung Museum', 'places', 'Salar Jung Road, Darulshifa, Hyderabad, Telangana 500002', 'Hyderabad', '17.372418', '78.480291', 'The Salar Jung Museum is an art museum located at Darushifa, on the southern bank of the Musi river in the city of Hyderabad, Telangana, India. It is one of the three National Museums of India.', 'Former art collection of the Salar Jung family from around the world, now a museum.', '2016-06-15 04:23:16', 'admin', NULL, NULL, 1),
(21, 'Chilukur Balaji Temple ', 'places', 'Chilkur Balaji Temple, Moinabad Mandal, Ranga Reddy District, Chilkur, Telangana 501504', 'HYDERABAD', '', '', 'Chilkur Balaji Temple, popularly known as "Visa Balaji Temple'''', is an ancient Hindu temple of Lord Balaji on the banks of Osman Sagar in Hyderabad. It is one of the oldest temples in Hyderabad built during the time of Madanna .', 'The Balaji Temple is located at Chilkur in the Hyderabad district. It is 33 Kms away from Mehedipatnam. Approximately 75,000 to 1,00,000 devotees visit in a week. Generally temple gets heavy rush on Fridays and Sundays.\r\n\r\nThe temple at Chilkur is managed by the hereditary trustee Sri M.V. Soundara Rajan and Sri C.S. Gopala Krishna. The entire family of the archaka, including the women are dedicated themselves to serve the God.', '2016-08-20 02:32:48', 'admin', '2016-08-21 01:38:05', 'admin', 1),
(25, 'Jala Vihar', 'kids', 'Necklace Road', 'Hyderabad, Telangana India', '17.43266', '78.464785', 'Make some fun memories at Jalavihar, an amusement park filled with rides suitable for adults and children. It is located on Necklace Road and is right next to the Hussain Sagar Lake that gives an incredible view.  It also features a party zone, meeting areas that are ideal for parties, festival events and corporate events. They also have a food court to satisfy those hunger pangs whilst the fun. The staff follows strict hygienic conditions to make sure that does not stop you from having fun.', 'Entry Pass Rs.200 per ticket', '2016-08-28 12:51:08', 'admin', NULL, NULL, 1),
(27, 'KHILLA GHANPUR / GHANPUR FORT', 'adventure', 'Khilla Ghanpur village, Mahabubnagar, Telangana', 'Mahabubnagar', '16.567286', '78.055924', 'At a distance of 2 km from Khilla Ghanpur Bus Stand, 25 km from Mahabubnagar and 109 km from Hyderabad, Khilla Ghanpur Fort is located near Khilla Ghanpur village in Mahabubnagar district of Telangana. This is an ideal weekend getaway from Hyderabad to spend full day.\r\n\r\nThe Ghanpur Fort is a hill fort built on a rocky hill by King Gona Ganapa Reddy in early 13th century. He ruled this area as a feudatory to Kakatiya rulers. Gona Ganapa Reddy is son of Gona Budda Reddy who was famous as the poet of Ranganatha Ramayana, a pioneering Telugu Literature. The name of Ghanapuram Killa came into existence from the name of Kakatiya Ruler Sri Ganapathi Deva. The fort is spread on rocky and hilly area of 4 Sq kilometers and there are fort buildings spread across the top most part of the hill.\r\n\r\nThe fort was well built with cannons on the upper side of the fort. There are several remains of the walls and building blocks inside the fort. There are several temples inside the fort like Veerabhadra Temple, Narsimh Temple and Chowdeswari Temple. There are several caves on the hilltop and provide good opportunity for exploration.\r\n\r\nThere are two ponds inside the fort with fresh water and they are good for swimming. There are several hills around the fort and they provide good opportunity for trekking as well. Ghanpur Lake is a large lake situated close to the Ghanpur village and the view of the lake from the fort is picturesque.\r\n\r\nThe fort & monuments demand about 2-3 kms trek from Ghanpur village. It usually takes about 2 hours to trek, explore the fort & caves and come back to Ghanpur village.', 'Distance (From Mahabubnagar): 25 Kms', '2016-08-29 16:42:16', 'admin', NULL, NULL, 1),
(28, 'KOILKONDA FORT AND KOILSAGAR DAM', 'adventure', 'Koilkonda, \r\nMahabubnagar, Telangana', 'Mahabubnagar', '16.7442948', '77.9846673', 'At a distance of 1.3 km from Koilkonda Bus Stand, 25 km from Mahabubnagar Bus Station and 128 km from Hyderabad, Koilkonda Fort is situated at Koilkonda in Mahabubnagar district of Telangana. This is an ideal weekend getaway from Hyderabad to spend full day.\r\n\r\nKoilkonda Fort is the erstwhile outpost of the Qutab Shahi dynasty situated on a hilltop. To reach the top, one needs to hike across a deep gorge on the west or a series of streams if coming through east before reaching a plight of steps that leads to the fort. To enter the Koilkonda Fort, seven gates have to be crossed. The first one spots an inscription of Ibrahim Qutab Shah that belongs to 1550 AD. Fourth gate leads to a dilapidated palace. There is also a mosque, an Idgah and a pond here. The Fort also has a ashurkhana dedicated to Bibi Fatima and is revered by both Hindus and Muslims.\r\n\r\nThe Kolisagar Dam is a medium-sized irrigation project that was constructed in the period of the \r\nNizams during 1945-48. The Koilsagar Dam, which is about 10 km from the Koilkonda, stretches across the Peddavagu River, a minor tributary of the River Krishna. The western stretch of this picturesque reservoir is surrounded by high hills, making it a beautiful spot and is a treat for eyes during sunrise and sunset.\r\n\r\nSri Ramkonda Hill is another prominent Hill with a temple dedicated to Lord Rama, which is 3 km from Koilkonda Fort. There is no motorable road to Sri Ramkonda Hill, one has to trek 3 km from the Fort. This hill is also famous for lot of herbal medicinal plants.\r\n\r\nThere is an another hill named Verrabhadra Swamy Hill nearby, to reach this hill one has to trek 2 km from Koilkonda Fort.', 'Distance (From Mahabubnagar): 25 Kms', '2016-08-29 16:44:58', 'admin', NULL, NULL, 1),
(29, 'KOULAS FORT', 'adventure', 'Koulas village, Nizamabad, Telangana.', 'Nizamabad', '18.323929', '77.697481', 'At a distance of 3 km from Koulas, 81 km from Nizamabad, 84 km from Medak and 169 km from Hyderabad, Koulas Fort is situated near Koulas village in Nizamabad district. \r\n\r\nKoulas Fort is a massive fort dating back to the 14th century, spread across 6 sq km and located in Jukkal mandal close to Bidar - Nanded road. This fort was built by Kakatiya rulers. This fort was conquered by Muslim rulers Bahamanis, Qutb Shahis and later occupied by the Nizams. \r\n\r\nThe Koulas Fort was constructed in the semi-Dravidian style at an altitude of about 1100 ft. There is a stream that stands as a natural moat to the fort. The fort is spread across 400 acres surrounded by large fortification wall with strong bastions. The fort houses several wonderfully built gateways, buildings, temples, mosques and other structures. There are about 20 large cannons spread across the fort. It has 52 small and big bastions along several water tanks. The fort temple and dargah were declared as protected monuments by the Archaeology Department.\r\n\r\nThe Kasikund temple was constructed on the patterns of the Kasi temple. There are three other temples dedicated to Rama, Hanuman and Balaji. Behind the fort is the Ashtabuji Mata also known as Jagadamba Mata temple. The fort is currently not well maintained and the approach route is full of thorns. Also, the fort becomes inaccessible during monsoons when the water levels in stream reach the peak.\r\n\r\nVisitors need to trek about 3 km to reach the Koulas Fort. It is advisable to take a villager as a guide from the Koulas village to visit the fort.\r\n\r\nThe Koulas dam is about 20 km away from the fort and attracts a large number of birds in winter.\r\n\r\nTimings: 9 AM to 6 PM.', 'Distance (From Nizamabad): 81 Kms', '2016-08-29 16:46:51', 'admin', NULL, NULL, 1),
(30, 'GAYATHRI WATERFALLS', 'adventure', 'Tarnam Khurd Village, Kuntala Waterfalls, Nirmal, Adilabad, Telangana.', 'Adilabad', '19.329862', '78.469344', 'At a distance of 5 km from Tarnam Khurd Village, 19 km from Kuntala Waterfalls, 38 km from Nirmal, 59 km Adilabad and 270 km from Hyderabad, Gayathri Waterfalls is a beautiful place located in Adilabad district of Telangana.\r\n\r\nGayatri waterfalls is a very less known place situated on Kadem River, a tributary of Godavari River. Along with Kuntala and Pochera Falls, Gayatri falls is another fascinating waterfalls in Adilabad district. This is a a magnificent waterfall and attracts large number of tourists in monsoon season.\r\n\r\nGayatri waterfall is also called as Gadidha Gundam or Mukti Gundam by the villagers. It is located at a very secluded place inside deep forest near Tarnam Khurd Village. This stunning waterfall is cascading down from a height of 100 ft into the valley to create a magnificent sight. There is a pool at the bottom of the falls and visitors can reach pool and swim. The rocks are very slippery should be careful while swimming in the pool.\r\n\r\nNeredigonda is 253 Km from Hyderabad on the way to Adilabad on NH 7. Kupti village comes after 6 km (on the same highway) where you will find sign board for Tarnam village on the right side. Turn right from here and drive for 2 Km on mud road to reach Tarnam Khurd village. One can go by vehicle only till Tarnam. From here 5 km trek is required to reach the falls. It is advisable to take a local from Tarnam Khurd village as a guide to reach this place.\r\n\r\nThere is an alternate road from Ichoda (between Neredigonda - Adilabad) via Manikpur and Tarnam Buzurg. Gayathri falls is only 2 km walk from Tarnam Buzurg. But the road between Manikpur and Tarnam Buzurg is pretty bad and becomes inaccessible during peak rains.\r\n\r\nTrek to the waterfalls is of a moderate level and may not be suitable with kids. You may not find much water in season other than monsoon. One should carry water and food while trekking to the falls as there are no shops around.\r\n\r\nFrom Tarnam Khurd, it takes about 3-4 hours to reach the falls, explore & play and come back to Tarnam.\r\n\r\nBest time to visit this place is peak monsoon (Sep-Oct).', 'Distance (From Adilabad): 59 Kms', '2016-08-29 16:49:35', 'admin', NULL, NULL, 1),
(31, 'KANAKAI WATERFALLS', 'adventure', 'Girnur Village, Kuntala waterfalls, Nirmal, Adilabad, Telangana.', 'Adilabad', '19.437941', '78.373485', 'At a distance of 2 km from Girnur Village, 35 km from Kuntala waterfalls, 54 km from Nirmal, 51 km Adilabad and 282 km from Hyderabad, Kanakai waterfalls is a nice waterfall on Kadem river located in Adilabad District of Telangana. This is also a good trekking destination. Bandrev waterfall and Cheekati Gundam are located in a single stretch along with Kanakai waterfalls and all three can be visited together.\r\n\r\nThe Kanakai waterfall, also called as Kanakadurga waterfalls is located near a small village called Girnur of Bazarhatnoor Mandal. There is also a Kanaka Durga temple located near the waterfall. Large number of devotees from nearby villages visit the temple during festivals. The waterfall is cascading down from a height of 30 ft. There is a big pool at the bottom of the fall. Swimming at the falls is a great experience for the visitors. When you climb up to the top of the falls, you can get the panoramic view of the falls and the surrounding area.\r\n\r\nThere are actually three falls at Kanakai. First is a small one where water flows through rocky formations forming small but wide waterfall with an average height of 10 feet, second one is the main falls (Bandrev waterfall) about 1 km from the first one where water cascades down into a big pool from a height of about 30 feet with a width of about 100 feet.. This is the place where a stream is merged into the Kadem river. Third one is called Cheekati Gundam which is few hundred meters away from the second one. It is similar to the first one with dense forest and dark surroundings. The whole area is covered with thick vegetation and sharp rock formations. \r\n\r\nIchoda is 273 Km from Hyderabad on the way to Adilabad on NH 7. From Ichoda, you have take left and drive towards Bazarhatnoor via Adegaon Khurd, Pipri and reach Girnur. After driving for 1 km from Girnur village, there is a sign board pointing towards a mud road on the left that leads to the temple and waterfalls. Vehicles can go further 1 km from here (not accessible in peak monsoons) and the first waterfall is further half km from there (15-20 minutes walk). It is advisable to hire a villager as guide from Girnur village.\r\n\r\nYou may not find much water in season other than monsoon. Carry enough water (shops available at Girnur). The rocks near the waterfalls are slippery and have to be careful while descending.\r\n\r\nIt takes about 3-4 hours to visit all three waterfalls, spend some time and come back to the road point.\r\n\r\nBest time to visit this waterfall is after monsoon (Aug-Oct).', 'Distance (From Adilabad): 51 Kms', '2016-08-29 16:51:50', 'admin', NULL, NULL, 1);
