(1, 'Nehru Zoological Park', 'ba3253876aed6bc22d4a6ff53d8406c6ad864195ed144ab5c87621b6c233b548baeae6956df346ec8c17f5ea10f35ee3cbc514797ed7ddd3145464e2a0bab413', 'Curator', 'Hyderabad', 'Hitechcity', 'Hyderabad', '500064', '', '8121412298', 'info@hydzoo.com', '', '2016-08-17 09:18:05', '2016-08-17 09:18:05', 1, '0', '0', NULL, 'Nehru Zoological Park, Hyderabad is one of the first zoos in the Country to display the animals in open moated enclosures with no barriers in between the visitors and the animals. The zoo was established with this concept and was opened to public viewing on 06.10.1963. Since then the zoo kept on adding new facilities. The Lion Safari Park which was established in 1974 and Nocturnal Animal House established in the year 1982 were first of its kind in the country.\r\n\r\nAt Present this zoo is displaying animals belonging to 140 species numbering 1334. During this period this zoo received Common Marmosets, Spoon Bills from Alipore Zoo, Kolkata. Pig Tailed Macaque, Himalayan Black Bear, Leopard Cats from Sipahijala Zoo, Tripura and Mouse Deers from Sri Venkateshwara Zoological Park, Tirupati, 6 Nos of White backed Vultures from Sakkarbagh Zoo There are other animal exchange programmes belongs this Zoo and Patna & Mysore Zoos in the pipe line.\r\n\r\nDuring this period most of the animal enclosures and visitor facilities were revamped. Efforts were made to make the zoo a plastic free area, A Plastic regulation counter was opened at the entrance gate which provides paper bags in place of polythine bags. Additional booking counters, Visitors Shelters, resting areas were created for the visitors.\r\n\r\nThis Zoo is spread over an area of 380 acres and a visitor can''t see all the enclosures in one day on foot. Therefore bicycles were introduced in the zoo, and the visitors can hire these bicycles and can go around the zoo. This is helping the visitors in visiting the zoo completely.', 'singlecheckout', 0),
(2, 'Alankrita Resorts', '123456', 'Suresh Babu', 'Shamirpet, NH 8', '', 'Hyderabad', '500064', '09014138751', '9885754456', 'sharma@gmail.com', '', '2016-08-19 03:21:19', '2016-08-19 03:21:19', 0, '0', '0', NULL, 'Aalankrita is the famous Hyderabad resort situated in Shamirpet, a man-made vision created in complete harmony with the panoramic beauty of Nature. From the moment you arrive, youll be taken in by its breathtaking landscaping and scenery, blended in the pleasure and luxury of a 4 star resort. The delight of being here will be further buoyed by detailed architecture and rich interiors complementing the resorts ethnic theme, ensuring that the truly enlivening experience will stay long in your memory.', 'singlecheckout', 0),
(3, 'Leonia.D', '123456', 'ramakrishna yendluri', 'Shamirpet, Hyderbad', '', 'Hyderabad', '500064', '040 2334569', '9885754457', 'leonia@gmail.com', '', '2016-08-19 03:20:28', '2016-08-19 03:20:28', 0, '0', '0', NULL, 'Nestled in lush gardens, this upscale resort offers accommodation in a collection of cottages. The resort is 6 km from Shamirpet Lake and 7 km from the Koteshwar Swamy Temple', 'singlecheckout', 50),
