(26, 'Lahari Resorts', '123456', 'Lahari Resorts', 'Bhanoor, Near Patancheru,', '', 'Hyderabad', '502305', '', '0123456789', 'info@lahariresorts.com', '', '2016-08-21 02:15:34', '2016-08-21 02:15:34', 1, '0', '0', NULL, 'Lahari Resort, a budget property is ideal for holidaying with friends and family and also for leisure cum business trip. The hotel is located at a distance of 53.7 km from Hyderabad International Airport, 20.6 km from Chandanagar Railway Station and 44.1 km from Shapur Nagar Bus Stand. The hotel is in proximity to various tourist places like Chilkur Balaji Temple, Sri Ramakrishna Math, Nehru Zoological Park, KBR National Park, Buddha Statue and many more. ', 'singlecheckout', 0),
(27, 'Honey Berg Resort', '123456', 'Honey Berg Resort', 'Muraharipalli Village, Near Genome Valley, Medchal Mandal, Ranga Reddy , ', '', 'Hyderabad', '500016', '', '0123456789', 'info@honeyberg.com', '', '2016-08-21 02:24:07', '2016-08-21 02:24:07', 1, '0', '0', NULL, 'Suchirindia Hotels & Resorts (P) Limited was set up by Suchirindia Group to foray into the hospitality sector. Resorts, Clubs, Theme Parks and other entertainment centers are being set up, initially in and around Hyderabad, major towns of Andhra Pradesh, metro cities in India and in due course overseas. Honey Berg is a 40,000 sq.ft, 3 Star boutique retreat located near Genome Valley, Shamirpet, Hyderabad. The highlighting factor of the resort is its architectural design which, while retaining the rocky terrain, seamlessly blends in with the surroundings. The magnificent glass faades and the rumbling waterfalls give it a distinct appearance and add substantially to the final panorama.The highlighting factor of the resort is its architectural design which, while retaining the rocky terrain, seamlessly blends in with the surroundings. The magnificent glass faades and the rumbling waterfalls give it a distinct appearance and add substantially to the final panorama.', 'singlecheckout', 0),
(28, 'Summer Green Resort', '123456', 'Summer Green Resort', 'Survey No. 90/A, 111, 112/A, 112B, Thumkunta Village, ', '', 'Survey No. 90/A, 111, 112/A, 112B, Thumkunta ', '500078', '', '0123456789', 'summer@gmail.com', '', '2016-08-21 02:31:54', '2016-08-21 02:31:54', 1, '0', '0', NULL, 'Summer Green plays perfect host as a gateway destination for families, friends or colleagues. The picturesque greenery, great ambiance & sprawling lawns are ideal for hosting weddings, birthday parties, family functions, Get-togethers, corporate seminars & launches.', 'singlecheckout', 0),
